import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import Typography from '@material-ui/core/Typography';
import CardContent from '@material-ui/core/CardContent';
import Divider from '@material-ui/core/Divider';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';

const styles = theme => ({
  jumbotron:{
    padding: '1rem 2rem',
    bottomMargin:'2rem',     
},
    center : {
        margin: 'auto',      
        minWidth: 1100,
        padding: 10,
        // border: '2px solid green'
      },
    card: {
        minWidth: 1100
    },           

      searchbar:{
        width: 1100
      },
      bottomSection:{
        // border: '2px solid blue'
      },
      featureHeatmap:{
          width: 250,     
        //   border: '2px solid yellow'
      },
      mainContainer:{
          overflow: 'scroll'
      },

});



class Try extends React.Component {
  state ={
    topicTagCountsInSubsectors: this.props.topic.topicTagCountsInSubsectors,
    subsectorPicture: this.props.topic.subsectorPicture,
    stringPicture: this.props.topic.stringPicture
    }

    componentDidMount(){
        this.setState({
            topicTagCountsInSubsectors: this.props.topic.topicTagCountsInSubsectors,
            subsectorPicture: this.props.topic.subsectorPicture,
            stringPicture: this.props.topic.stringPicture
    });}

    componentWillReceiveProps(nextProps){
        this.setState({
            topicTagCountsInSubsectors: nextProps.topic.topicTagCountsInSubsectors,
            subsectorPicture: nextProps.topic.subsectorPicture,
            stringPicture: nextProps.topic.stringPicture
    });
      }

      render(){  
        const {classes} = this.props;
        //const{topicTagCountsInSubsectors} = this.state;
    return (
            <div>
            <div className={classes.jumbotron}>
            <Grid container justify = "center">
                <Card className={classes.card}>
                    <CardContent >
                    <Typography gutterBottom variant="h6" component="h5">
                            General
                        </Typography>
                    </CardContent>
                    <Divider variant="middle"/>
                    <CardContent >
                    {/*<Typography component="div" className={classes.contentHolder}>
              <Grid container spacing={24} direction="column" wrap="nowrap" 
                    justify="flex-start" className={classes.mainContainer}> 
                <Grid item>
                <img src={(this.state.topicTagCountsInSubsectors)}/>
                </Grid>  
                <Grid item>
                <img src={(this.state.subsectorPicture)}/>
                </Grid>
                <Grid item>
                <img src={(this.state.stringPicture)}/>
                </Grid> 
              </Grid>
            </Typography>*/}
            <Paper>  

<CardContent className={classes.sectionHolder}>

  <Typography component="div" >
          {/* Chexmix and Subsector Heatmap Section */}
          <Grid container spacing={16} direction="column" wrap="nowrap" 
          justify="flex-start" className={classes.mainContainer}>

                  {/* Buffer Section */}
                  <Grid item >
                                  <img src={this.state.topicTagCountsInSubsectors} alt="Topic Tag Counts In Subsectors"
                                  className={classes.featureHeatmap}/>
                              </Grid>

                  {/* Bottom Section */}
                  <Grid item className={classes.bottomSection}>                               
                      <Grid container 
                          direction="column"
                          justify="space-evenly"
                          alignItems="flex-start"
                          spacing={0}
                      >

                              <Grid item >
                                  <img src={this.state.subsectorPicture} alt="Subsector Picture"
                                  className={classes.featureHeatmap}/>
                              </Grid>
                              {<Grid item >
                                  <img src={this.state.stringPicture} alt="String Picture"
                                  className={classes.featureHeatmap}/>
                              </Grid>}

                      </Grid>
                  </Grid>               
          </Grid>  
  </Typography>

</CardContent>

</Paper> 
                    </CardContent>

                </Card>
            </Grid>
                <br/> 
                {/* Sample Explore Table */}

            </div>
            </div>

    );
}}

Try.propTypes = {
    classes: PropTypes.object.isRequired,
  };

  export default withStyles(styles)(Try);
